import React, { useState } from 'react';
// import logo from '../images/logo.png';
import ToggleButton from 'react-toggle-button';


function Nav(props) {
  const [toggle, setToggle] = useState(false);

  return (
    <nav>
      <ul>
        <li>logo</li>
      </ul>
      <ul>
        <ToggleButton
          onClick={()=> setToggle()}
        />
      </ul>
    </nav>
  );
}

export default Nav;
